import React, { useState } from "react";
import { createCash } from "../api/CashApi";

const NewCash = ({ onClose, onNewCash }) => {
  const [formData, setFormData] = useState({
    entry_date: "",
    initial_cash: 0,
    user_id: 0,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log(formData);
    try {
      const newCash = await createCash({
        ...formData,
        initial_cash: parseFloat(formData.initial_cash),
        user_id: parseInt(formData.user_id),
      });
      console.log(newCash);
      onNewCash(newCash);
      alert("Cash entry submitted successfully");
      onClose();
    } catch (error) {
      console.error("Error submitting cash entry:", error);
      alert("Error submitting cash entry");
    }
  };

  return (
    <div className="modal">
      <div className="new-cash-container">
        <div className="header-card">
          <p className="title">Add Cash Entry</p>
          <p className="close-btn" onClick={onClose}>
            &times;
          </p>
        </div>
        <hr />
        <form onSubmit={handleSubmit} className="form-container">
          <label>
            <input
              type="text"
              placeholder="User ID"
              name="user_id"
              value={formData.user_id}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="number"
              placeholder="Initial Cash"
              name="initial_cash"
              value={formData.initial_cash}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="date"
              placeholder="Entry Date"
              name="entry_date"
              value={formData.entry_date}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <button type="submit">Add</button>
        </form>
      </div>
    </div>
  );
};

export default NewCash;
